    public List<NewRegisterUserEventResponse> getNewRegisterUserEvents(TransactionReceipt transactionReceipt) {
        List<Contract.EventValuesWithLog> valueList = extractEventParametersWithLog(NEWREGISTERUSER_EVENT, transactionReceipt);
        ArrayList<NewRegisterUserEventResponse> responses = new ArrayList<NewRegisterUserEventResponse>(valueList.size());
        for (Contract.EventValuesWithLog eventValues : valueList) {
            NewRegisterUserEventResponse typedResponse = new NewRegisterUserEventResponse();
            typedResponse.log = eventValues.getLog();
            typedResponse._userId = (String) eventValues.getNonIndexedValues().get(0).getValue();
            typedResponse._fUserId = (String) eventValues.getNonIndexedValues().get(1).getValue();
            typedResponse.add = (String) eventValues.getNonIndexedValues().get(2).getValue();
            typedResponse.status = (BigInteger) eventValues.getNonIndexedValues().get(3).getValue();
            responses.add(typedResponse);
        }
        return responses;
    }

